import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Switch } from 'react-router';

function App() {
  return (
    <Switch>
      <Route path="/login">
        <LoginPage/>
      </Route>
      <PrivateRoute path="/admin">
        <AdminLayout/>
      </PrivateRoute>
      <Route>
        <NotFound/>
      </Route>
    </Switch>
  );
}

export default App;
